<?php
if ( !defined('K_COUCH_DIR') ){
    $logo_light = "";
    $logo_dark = "";

    $logo = $logo_light;
    if( isset($_GET['d']{0}) ){
        $d = (int)$_GET['d'];
        if( $d==1 ) $logo = $logo_dark;
    }
    header('Content-Type: image/gif');
    echo base64_decode( $logo );
    die;
}
else{
    define( 'K_COUCH_LOGO_FILE', 1 );
}
